import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Portfolio from './components/Portfolio';
import Nav from './components/Navigation';
import Skills from './components/Skills';  // Correct the import to match the component name

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/portfolio" element={<Portfolio />} />
        <Route path="/navigation" element={<Nav />} />  
        <Route path="/myskills" element={<Skills />} />  {/* Use Skills component */}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
